import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different approach
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });
    await page.waitForSelector('body', { timeout: 5000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards and add multiple items to cart
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Get all add-to-cart buttons
    const addButtons = await page.$$('.product-card .add-to-cart');

    // Rapidly click all add-to-cart buttons
    for (const button of addButtons) {
      await button.click();
      await page.waitForTimeout(100); // Small delay between clicks
    }

    // Take screenshot after adding items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Manipulate quantities in cart
    const quantityButtons = await page.$$('.quantity-btn');
    for (let i = 0; i < Math.min(3, quantityButtons.length); i++) {
      await quantityButtons[i].click();
      await page.waitForTimeout(100);
    }

    // Remove some items
    const removeButtons = await page.$$('.remove-item');
    for (let i = 0; i < Math.min(2, removeButtons.length); i++) {
      await removeButtons[i].click();
      await page.waitForTimeout(100);
    }

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modified.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modified.png'));

    // Extract cart data
    const cartCount = await page.textContent('.cart');
    const cartItems = await page.$$eval('.cart-item', items => 
      items.map(item => ({
        title: item.querySelector('.cart-item-title')?.textContent || '',
        price: item.querySelector('.cart-item-price')?.textContent || '',
        quantity: item.querySelector('.quantity')?.textContent || ''
      }))
    );

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test with multiple add/remove operations",
      extractedData: {
        finalCartCount: cartCount.trim(),
        cartItems: cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
